import React from 'react'
import {NavLink} from 'react-router-dom'

const SignedInLinks = () =>  {
    return ( 
         <ul className="right">
            <li><NavLink to='/'>Log Out</NavLink></li>
            <li><NavLink to="/" class="glyphicon glyphicon-user"></NavLink></li>
            <li><NavLink to="/" className="">B</NavLink></li>
        </ul>
    );
}
 
export default SignedInLinks;
